    false,nt"url": null,nt"notes": "This annual narrative report for Crosby
    National Wildlife Refuge outlines Refuge accomplishments during the 1988 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. Refuge administration is outlined; information about
    personnel, funding, and safety is given. Habitat management is also covered; subjects
    include wetlands, croplands, grazing, haying, pest control, and WPA easements. The
    wildlife section of the report discusses endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, and surplus animal
    disposal. The public uses of the Refuge described in this report include hunting,
    fishing, trapping, and law enforcement. The equipment and facilities section of
    the report provides information about new construction and equipment replacement.
    Cooperative programs and items of interest are provided at the end. Refuge brochures
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
